import { createBrowserRouter, RouterProvider } from "react-router-dom";

import "./App.css";
import Home from "./components/Home";
import PirateLogin from "./components/PirateLogin";
import AdminLogin from "./components/AdminLogin";
import PirateSignup from "./components/PirateSignup";
import Clue1 from "./components/Clue1";
import Error from "./components/Error";
function App() {
  const router = createBrowserRouter([
    { path: "/", element: <Home /> },
    { path: "/pirate", element: <PirateLogin /> },
    { path: "/admin", element: <AdminLogin /> },
    { path: "/piratesignup", element: <PirateSignup /> },
    { path: "/pirate/clue1", element: <Clue1 /> },
    { path: "/pirate/error", element: <Error /> },
  ]);
  // return (
  //   <div className="App">
  //     <Home />
  //     <PirateLogin />
  //   </div>

  return (
    <RouterProvider router={router}>
      {/* <Home />
      <PirateLogin /> */}
    </RouterProvider>
  );
}

export default App;
